import CarBrowsing from "./CarBrowsing";

const filterCars = (subcategory, setCars) => {
    fetch("http://localhost:3001/cars.json")
        .then((res) => res.json())
        .then((cars) => {
            console.log(cars); // Debugging: Inspect the fetched data
            if (Array.isArray(cars)) {
                const result = cars.filter((curData) => {
                    return curData.seats === subcategory;
                });
                setCars(result);
            } else {
                console.error("Fetched data is not an array:", cars);
            }
        })
        .catch((error) => {
            console.error("Error fetching car.json:", error);
        });
};

export default filterCars;
